import React, { Component } from 'react';
import { connect } from 'react-redux';

class HighlightedCities extends Component {
  render() {
    return <div>HighlightedCities</div>;
  }
}

const mapStateToProps = state => {
  return { state: state.fetchCities };
};

export default connect(mapStateToProps, { fetchCities })(HighlightedCities);
